import React, { useState } from 'react';

import "./navbar.css"; 

import { Link } from "react-router-dom";

const Navbar = () => {

    const [searchValue, setSearchValue] = useState("");

    const onChangeSearchValue = event => {
        setSearchValue(event.target.value);
        if (event.target.value === "") return;
    }

    const onClickSearch = () => {
    }

    const viewportWide = <div>
                            <Link to="/log-in" className='user'>Log In</Link>
                            <Link to="/sign-up" className='user'>Sign Up</Link>
                        </div>

    let viewportStrict;

    return (
        <nav>
            <div>
                <Link to="/">
                    <span className="material-symbols-outlined home">home</span>
                </Link>
                <input type="text" className="search" placeholder='search...' value={searchValue} onChange={onChangeSearchValue}></input>
                <button onClick={onClickSearch}><span className="material-symbols-outlined lens">search</span></button>
            </div>
            {window.innerWidth < 768 ? viewportWide : null}
        </nav>
    )
}

export default Navbar;
